import './App.css';
import { Component } from 'react';
import { BrowserRouter, Route, Link} from "router-react-dom"

class register extends Component{
  render(){
    return(
      aa
    )
  }
}

class App extends Component{
  constructor(props){
    super(props)
    this.state={
      password : ""
    }
  }

  render(){
    return (
  <BrowserRouter>
  <div id="card">
    <div id="card-content">
      <div className="App">
        <div id="card-title">
          <h2>LOGIN</h2>
          <div class="underline-title"></div>
        </div>
        <form id="userForm" class="form">
          <label for="user-email" style={{paddingTop:"13px"}}>
              &nbsp;User Name
            </label>
          <input class="form-content"  name="User Name" autocomplete="on" required />
          <div class="form-border"></div>
          <label for="user-password" style={{paddingTop:"22px"}}>&nbsp;Password
            </label>
          <input class="form-content" type="password" name="password" required />
          <div class="form-border"></div>
          <a href="#">
            <legend id="forgot-pass"></legend>
          </a>
          <input id="submit-btn" type="submit" name="submit" value="LOGIN" />
          <a href="#" id="signup"></a>
        </form>
        <a href="register">
          or Register
        </a>
      </div>
    </div>
    <Route path = "/register" exact component = {register}/>
    <Route path = "/enter" exact component = {enter}/>
  </div>
  </BrowserRouter>
    );
  }
}

export default App;
